2/ At the same time, I had many experiences of churches who fought hard for LGBTQ and women's rights, who fought racism, who fought poverty.

But the point of a grant for COVID-19 response is about keeping workers and clients safe. 

We didn't restrict CERB to a taxpaying level;

COVID-19 hit domestic workers hard--and their Spanish-speaking workers the hardest. Many didna't have enough money to pay their rent or mortgage. 

These workers need a national #PaidLeave policy that will protect them.

